const data = flow.get('data');
const i = msg.count;
const timestamp = msg.payload;
let msgList = [];

const record = data[i % data.length];

for (let k in record) {
    // tagName = k.toLowerCase().replace(/_/g, '-');
    tagName = k.toLowerCase();
    msgPayload = {
        'timestamp': timestamp,
        'tagName': `cncmilling_${tagName}`,
        'value': record[k]
    };
    msgList.push({payload: msgPayload});
}

return [msgList];
